.portal-box-body {
  height: 100%;
  overflow: auto;
  .text {
    margin: 15px;
  }
}
.row-title {
  margin: 0 20px;
  border-bottom: 1px solid #ebeef5;

  &:last-child {
    border-bottom: unset;
  }

  .title {
    padding: 12px 0 8px;
  }
  .content {
    padding-bottom: 8px;
  }
}
.divider-margin {
  margin: 0px 0px;
}
.app-title {
  width: 100%;
  padding-top: 5px;
}
.portal-table-box-body {
  height: 100%;
  overflow: auto;
}
.portal-table-box {
  display: flex;
  flex-direction: column;
  >>> .el-card__header {
    height: 55px;
    padding: 0;
  }

  >>> .el-card__body {
    width: 100%;
    flex: 1;
    overflow: hidden;
  }

  .portal-table-box-body {
    display: flex;
    flex-direction: column;
    height: 100%;
    overflow: auto;

    .item {
      display: block;
      line-height: 20px;
      font-size: 0;
      margin: 0 20px;
      border-bottom: 1px solid #ebeef5;

      &:last-child {
        border-bottom: unset;
      }

      .name {
        padding: 12px 0 8px;
      }
      .time {
        padding: 12px 0 8px;
        font-size: 14px;
        display: inline-block;
        color: #999;
        width: 120px;
        text-align: right;
      }
      .content {
        padding-bottom: 8px;
      }
    }
  }
}
.tableList {
  height: 100%;
  >>> .el-table tr:last-child td {
    border-bottom: unset;
  }
}
.name {
  font-size: 14px;
  display: inline-block;
  width: calc(100% - 120px);
  white-space: nowrap;
  text-overflow: ellipsis;
  overflow: hidden;
  word-break: break-all;
  vertical-align: top;
}
.app-name {
  font-size: 14px;
  display: inline-block;
  width: 100%;
  white-space: nowrap;
  text-overflow: ellipsis;
  overflow: hidden;
  word-break: break-all;
  vertical-align: top;
}
